startString = ""
counter = 0

for x in range(0, len(startString) - 13):
    fourChars = startString[x] + startString[x + 1] + startString[x + 2] + startString[x + 3] + startString[x + 4] + startString[x + 5] + startString[x + 6] + startString[x + 7] + startString[x + 8] + startString[x + 9] + startString[x + 10] + startString[x + 11] + startString[x + 12] + startString[x + 13]
    counter += 1

    if len(set(fourChars)) == len(fourChars):
        print(counter + 13)
        break
